import React from 'react';
import './Table.css';


export default function Table({ passCourses, suggestedSubjects }) {
  return (
    <div style={{ padding: '1rem' }}>
      <h3>✅ Debugging Passed Courses</h3>
      {passCourses.length > 0 ? (
        <p>✔️ Passed subjects received.</p>
      ) : (
        <p>❌ No passed subjects received.</p>
      )}

      <h3>💡 Debugging Suggested Subjects</h3>
      {suggestedSubjects.length > 0 ? (
        <p>✔️ Suggested subjects received.</p>
      ) : (
        <p>❌ No suggested subjects received.</p>
      )}
    </div>
  );
}


